window.bookSummaryJSON = "<p><i>Ahren</i>: Ahren's life consists of being beaten up by his drunkard father or bullied by the village lads. But at the annual suitability tests for apprenticeships, the young boy finds himself selected by Falk, the guardian of the forest, to be his apprentice and his world is turned upside down.</p> <p>From his new master, he learns the skills of archery and how to fight the Dark Ones. And then, on the day of the Spring Ceremony, there is another unexpected turn of events. He touches the Stone of the Gods and it illuminates for the first time ever. It isn't long before a cantankerous wizard turns up and urges Falk and Ahren into action.</p> <p><i>The Naming</i>: Two Einhans have been found but the third is still at large. Time is of the essence. Ahren's Appointment as the 13th Paladin - assisted by the three Einhans - must occur by the winter solstice. If not, He, Who Forces will awaken before his time and plunge the unprepared peoples of Jorath into the depths of darkness.</p> <p><i>The Brazen City</i>: The saga of the 13th Paladin continues. Join him and his friends on their adventures in the Sunplains and enjoy meeting his old friends in Deepstone again.</p> <p>Note: This audiobook includes Books 1-3 in the 13th Paladin series.</p>"; 
